size_t
to_lower(const unicode_t code_point, unicode_t code_points[3]) {
  const auto &ctype = get_unicode_ctype(code_point);
  size_t n;
  if ((ctype.flags & UNICODE_CTYPE_FLAG_SPECIAL_CASING) == 0) {
    n = 1;
    code_points[0] = code_point + ctype.lower;
  }
  else {
    const auto &data = get_unicode_data(code_point);
    const size_t index = ((data.special_casing >> 8) & 0xFF);
    n = ((data.special_casing >> 26) & 0x03);
    for (size_t i = 0; i != n; ++i)
      code_points[i] = SPECIAL_CASING_DATA[index][i];
  }
  return n;
}




